const changelog = [{
  "version": "2.28.0",
  "date": "2022-01-07",
  "feature": ['<p>The limit parameter of the <code>Upload</code> component supports specifying that the upload node is disabled after the limit number is exceeded(<a href="https://github.com/arco-design/arco-design/pull/416">#416</a>)</p>\n']
}, {
  "version": "2.27.1",
  "date": "2021-12-24",
  "bugfix": ['<p>Fix the bug that only 100 files will be uploaded when the upload component is dragged to upload a folder.(<a href="https://github.com/arco-design/arco-design/pull/357">#357</a>)</p>\n']
}, {
  "version": "2.27.0",
  "date": "2021-12-17",
  "style": ['<p>Fix the style problem of the margin when the upload file list is empty in the <code>Upload</code> component(<a href="https://github.com/arco-design/arco-design/pull/336">#336</a>)</p>\n']
}, {
  "version": "2.26.2",
  "date": "2021-12-10",
  "bugfix": ['<p>Fix the bug that the request cannot be terminated when the <code>CustomRequest</code> setting of the <code>Upload</code> component is an asynchronous function.(<a href="https://github.com/arco-design/arco-design/pull/306">#306</a>)</p>\n']
}, {
  "version": "2.26.1",
  "date": "2021-12-07",
  "bugfix": ['<p>Fix the bug that the upload folder does not take effect when dragging and dropping the upload component.(<a href="https://github.com/arco-design/arco-design/pull/275">#275</a>)</p>\n']
}, {
  "version": "2.26.0",
  "date": "2021-12-03",
  "bugfix": ['<p>Fix the bug that when the <code>Upload</code> component uploads a folder, the second parameter of <code>beforeUpload</code> does not get all the files uploaded this time.(<a href="https://github.com/arco-design/arco-design/pull/252">#252</a>)</p>\n']
}, {
  "version": "2.25.1",
  "date": "2021-11-26",
  "bugfix": ['<p>Fix the bug that the upload node still shows the highlighted style when the <code>Upload</code> component is dragged out.(<a href="https://github.com/arco-design/arco-design/pull/234">#234</a>)</p>\n']
}, {
  "version": "2.23.0",
  "date": "2021-09-27",
  "typescript": ["<p>Fix the problem that the <code>Upload</code> component loses the export of <code>RequestOptions</code> and <code>UploadRequestReturn</code> type definitions</p>\n"]
}, {
  "version": "2.20.0",
  "date": "2021-07-30",
  "feature": ["<p>The <code>Upload</code> component supports the display of error messages from the <code>response</code> field of the uploaded file when the upload fails.</p>\n"]
}, {
  "version": "2.19.3",
  "date": "2021-07-23",
  "bugfix": ["<p>Fix the bug that the <code>directory</code> attribute of the <code>Upload</code> component is set to the div tag which causes the console to warn.</p>\n", "<p>Fix the problem that the display width of individual pictures is 0 when uploading multiple pictures in a special scene when the <code>Upload</code> component is set to <code>listType=&quot;picture-card&quot;</code>.</p>\n"]
}, {
  "version": "2.16.0",
  "date": "2021-05-28",
  "feature": ["<p>The <code>Upload</code> component supports returning a file object in the <code>beforeUpload</code> method for processing files.</p>\n"]
}, {
  "version": "2.15.0",
  "date": "2021-04-30",
  "bugfix": ["<p>Fix the bug that the Excel file type is judged abnormally when uploading files by dragging and dropping files by the <code>Upload</code> component.</p>\n"]
}, {
  "version": "2.14.0",
  "date": "2021-04-09",
  "bugfix": ["<p>Fix the bug that the state of the parent component accessed by the <code>Upload</code> component is not the latest value when calling <code>customRequest</code>.</p>\n"]
}, {
  "version": "2.13.2",
  "date": "2021-04-01",
  "bugfix": ["<p>Fixed the issue of flickering styles during and after the dragging of the <code>Upload</code> component when dragging.</p>\n", "<p>Fix the bug that the console warning appears when uploading the <code>Upload</code> component.</p>\n"]
}, {
  "version": "2.11.0",
  "date": "2021-03-12",
  "feature": ["<p>The <code>Upload</code> component supports folder upload.</p>\n"]
}, {
  "version": "2.7.0",
  "date": "2021-01-15",
  "style": ["<p>Fix the problem of blank space after the upload node is hidden when the <code>Upload</code> component exceeds the <code>limit</code> limit.</p>\n"]
}];
